import React from "react";
import LoadingScreen from "./loading";

export default class EntityFieldGroups extends React.Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        if (this.props.sections) {
            return (
                this.props.sections.map((section, index) => {
                    return (
                        <table class="fancy-table optimizedForSideDetail">
                            <thead>
                                <tr>
                                    <th style="border-radius: 16px 0 0 0;">
                                        <span>{section.name} </span>
                                        <span style="float: right; color: #0BA5DD; cursor: pointer">Unlock Editing</span>
                                    </th>
                                </tr>
                            </thead>
                            <tbody>

                            </tbody>
                        </table>
                    )
                })
            );
        } else {
            // loading screen
            return <LoadingScreen/>
        }
    }
}
